import React from 'react';
import '../../../assets/styles/components/CharacterCard.css'

interface Placeholder {
    placeholderCount: number;
}

const CharacterListPlaceholders = ({
    placeholderCount
}: Placeholder) => {
    return (
        <>
            {Array.from(Array(placeholderCount)).map((x, index: number) => <article key={index} className="character placeholder"></article>)}
        </>
    );
};

export default CharacterListPlaceholders;
